import React, { useState } from "react";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import Drawer from "@mui/material/Drawer";
import Toolbar from "@mui/material/Toolbar";
import List from "@mui/material/List";
import Divider from "@mui/material/Divider";
import ListItemComponent from "./ListItemComponent";
import Box from "@mui/material/Box";
import GridDados from "../Grids/GridDados";
import GridArquivos from "../Grids/GridArquivos";
import "./Sidebar.scss";

export default function DrawerComponent() {
  return (
    <Router>
      <Drawer
        className="muiDrawer-root & .muiDrawer-paper"
        variant="permanent"
        anchor="left"
      >
        <Toolbar />
        <Divider />
        <List>
          <NavLink to="/visualizarDadosXML">
            <ListItemComponent text="Visualizar dados XML" />
          </NavLink>
          <NavLink to="/visualizarArquivo">
            <ListItemComponent text="Visualizar arquivo" />
          </NavLink>
        </List>
      </Drawer>

      <Box component="main" className="main-container">
        <Toolbar />
        <Route path="/visualizarDadosXML" component={GridDados} />
        <Route path="/visualizarArquivo" component={GridArquivos} />
      </Box>
    </Router>
  );
}
